CREATE FUNCTION _array_of_includes(query text) RETURNS jsonb
    LANGUAGE sql IMMUTABLE
    AS $$
  SELECT json_agg((x->'value')::json)::jsonb
    FROM jsonb_array_elements(_parse_param(query)) x
    WHERE x->>'param' = '_include'
$$;


