--
-- Name: _ids_expression(text, text); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION _ids_expression(_tbl_ text, ids text) RETURNS text
    LANGUAGE sql IMMUTABLE
    AS $$
SELECT CASE
    WHEN ids IS NULL THEN '(true = true)'
    ELSE
      (
        SELECT ' ( ' || string_agg(y.exp,' OR ') || ')' FROM (
          SELECT _tbl_ || '.logical_id=' || quote_literal(x) AS exp
           FROM regexp_split_to_table(ids, ',') x
        ) y
      )
    END
$$;


--
-- Name: _index_res_ref_recur(character varying[], jsonb); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION _index_res_ref_recur(path character varying[], res jsonb) RETURNS jsonb[]
    LANGUAGE plpgsql
    AS $_$
DECLARE
  -- t text = jsonb_typeof(res);
  r record;
  ref varchar;
  ref_parts varchar[];
  result jsonb[];
BEGIN
  -- RAISE NOTICE '!!! %', res;
  CASE jsonb_typeof(res)
  WHEN 'object' THEN
    FOR r IN SELECT * FROM jsonb_each(res)
    LOOP
      CASE jsonb_typeof(r.value)
      WHEN 'string' THEN
        ref := jsonb_text_value(r.value);
        IF r.key = 'reference' AND ref ~ '^[a-zA-Z]+/.+$' THEN
          ref_parts := regexp_split_to_array(ref, '/');
          result := result || json_build_object('path', array_to_string(path, '.'), 'reference_type', ref_parts[1], 'logical_id', ref_parts[2])::jsonb;
        END IF;
      WHEN 'object', 'array' THEN
        result := result || _index_res_ref_recur(array_append(path, r.key::varchar), r.value);
      ELSE -- noop
      END CASE;
    END LOOP;
  WHEN 'array' THEN
    FOR r IN SELECT * FROM jsonb_array_elements(res)
    LOOP
      result := result || _index_res_ref_recur(path, r.value);
    END LOOP;
  ELSE -- noop
  END CASE;

  RETURN result;
END
$_$;


