--
-- Name: convert_fhir_date_to_pgrange(character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION convert_fhir_date_to_pgrange(d character varying) RETURNS tstzrange
    LANGUAGE plpgsql
    AS $_$
DECLARE
  d1 timestamptz;
BEGIN
  CASE
  WHEN d ~ '^\d\d\d\d$' THEN    -- year
  RETURN tstzrange((d || '-01-01 00:00:00')::timestamptz, (d || '-12-31 23:59:59')::timestamptz);
  WHEN d ~ '^\d\d\d\d-\d\d$' THEN -- month
    d1 := (d || '-01 00:00:00')::timestamptz;
    RETURN tstzrange(d1, d1 + interval '1 month' - interval '1 second');
  WHEN d ~ '^\d\d\d\d-\d\d-\d\d$' THEN -- day
    d1 := (d || ' 00:00:00')::timestamptz;
    RETURN tstzrange(d1, d1 + interval '23 hours 59 minutes 59 seconds');
  WHEN d ~ '^\d\d\d\d-\d\d-\d\d( |T)\d\d$' THEN -- hour
    d1 := (d || ':00:00')::timestamptz;
    RETURN tstzrange(d1, d1 + interval '59 minutes 59 seconds');
  WHEN d ~ '^\d\d\d\d-\d\d-\d\d( |T)\d\d:\d\d$' THEN -- minute
    d1 := (d || ':00')::timestamptz;
    RETURN tstzrange(d1, d1 + interval '59 seconds');
  WHEN d ~ '^\d\d\d\d-\d\d-\d\d( |T)\d\d:\d\d:\d\d(\.\d+)?((\+|\-)\d\d:\d\d)?$' THEN -- full date
    RETURN ('[' || d || ',' || d || ']')::tstzrange;
  ELSE
    RAISE EXCEPTION 'unknown date format: %', d;
  END CASE;
END;
$_$;


--
-- Name: create_tags(uuid, uuid, character varying, jsonb); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION create_tags(_id uuid, _vid uuid, res_type character varying, _tags jsonb) RETURNS uuid
    LANGUAGE plpgsql
    AS $_$
BEGIN
  EXECUTE
    _tpl($SQL$
      INSERT INTO {{tbl}}_tag
      (resource_id, resource_version_id, scheme, term, label)
      SELECT $1, $2, tg->>'scheme', tg->>'term', tg->>'label'
      FROM jsonb_array_elements($3) tg
    $SQL$, 'tbl', res_type)
  USING _id, _vid, _tags;
  RETURN _id;
END
$_$;


--
-- Name: delete_resource(uuid, character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION delete_resource(id uuid, res_type character varying) RETURNS uuid
    LANGUAGE plpgsql
    AS $_$
DECLARE
BEGIN
  EXECUTE
    _tpl($SQL$
      INSERT INTO "{{tbl}}_history"
      (version_id, logical_id, updated, published, content)
      SELECT version_id, logical_id, updated, published, content
      FROM {{tbl}}
      WHERE logical_id = $1;

      INSERT INTO "{{tbl}}_tag_history"
      (_id, resource_id, resource_version_id, scheme, term, label)
      SELECT _id, resource_id, resource_version_id, scheme, term, label
      FROM {{tbl}}_tag
      WHERE resource_id = $1;

      DELETE FROM "{{tbl}}_sort" WHERE resource_id = $1;
      DELETE FROM "{{tbl}}_tag" WHERE resource_id = $1;
      DELETE FROM "{{tbl}}_search_string" WHERE resource_id = $1;
      DELETE FROM "{{tbl}}_search_token" WHERE resource_id = $1;
      DELETE FROM "{{tbl}}_search_date" WHERE resource_id = $1;
      DELETE FROM "{{tbl}}_search_reference" WHERE resource_id = $1;
      DELETE FROM "{{tbl}}_search_quantity" WHERE resource_id = $1;
      DELETE FROM "{{tbl}}_references" WHERE resource_id = $1;
      DELETE FROM "{{tbl}}" WHERE logical_id = $1;
    $SQL$, 'tbl', lower(res_type))
  USING id;

  RETURN id;
END
$_$;


--
-- Name: fhir_affix_tags(jsonb, character varying, uuid, jsonb); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION fhir_affix_tags(_cfg jsonb, _res_type character varying, _id_ uuid, _tags jsonb) RETURNS jsonb
    LANGUAGE plpgsql
    AS $_$
DECLARE
  res jsonb;
BEGIN
  EXECUTE
    _tpl($SQL$
      WITH rsrs AS (
        SELECT logical_id, version_id
        FROM  "{{tbl}}"
        WHERE logical_id = $1
      ),
      old_tags AS (
        SELECT scheme, term, label FROM {{tbl}}_tag
        WHERE resource_id = $1
      ),
      new_tags AS (
        SELECT x->>'scheme' as scheme,
               x->>'term' as term,
               x->>'label' as label
        FROM jsonb_array_elements($2) x
        EXCEPT
        SELECT * from old_tags
      ),
      inserted AS (
        INSERT INTO "{{tbl}}_tag"
        (resource_id, resource_version_id, scheme, term, label)
        SELECT rsrs.logical_id,
               rsrs.version_id,
               new_tags.scheme,
               new_tags.term,
               new_tags.label
          FROM new_tags, rsrs
        RETURNING scheme, term, label)
      SELECT coalesce(json_agg(row_to_json(inserted)), '[]'::json)::jsonb
        FROM inserted
      $SQL$, 'tbl', lower(_res_type))
    INTO res USING _id_, _tags;

    UPDATE resource SET category = (SELECT json_agg(x)::jsonb FROM (SELECT t.term, t.scheme, t.label FROM tag t WHERE  t.resource_id = _id_) x)
     WHERE resource_type = _res_type
      AND logical_id = _id_;
    RETURN res;
END;
$_$;


--
-- Name: fhir_affix_tags(jsonb, character varying, uuid, uuid, jsonb); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION fhir_affix_tags(_cfg jsonb, _res_type character varying, _id_ uuid, _vid_ uuid, _tags jsonb) RETURNS jsonb
    LANGUAGE plpgsql
    AS $_$
DECLARE
  res jsonb;
BEGIN
  EXECUTE
    _tpl($SQL$
      WITH rsrs AS (
        SELECT logical_id,
               version_id
        FROM  "{{tbl}}_history"
        WHERE version_id = $1
      ),
      old_tags AS (
        SELECT scheme, term, label FROM {{tbl}}_tag_history
        WHERE resource_version_id = $1
      ),
      new_tags AS (
        SELECT x->>'scheme' as scheme,
               x->>'term' as term,
               x->>'label' as label
        FROM jsonb_array_elements($2) x
        EXCEPT
        SELECT * from old_tags
      ),
      inserted AS (
        INSERT INTO "{{tbl}}_tag_history"
        (resource_id, resource_version_id, scheme, term, label)
        SELECT rsrs.logical_id,
               rsrs.version_id,
               new_tags.scheme,
               new_tags.term,
               new_tags.label
          FROM new_tags, rsrs
        RETURNING scheme, term, label)
      SELECT coalesce(json_agg(row_to_json(inserted)), '[]'::json)::jsonb
        FROM inserted
      $SQL$, 'tbl', lower(_res_type))
    INTO res USING _vid_, _tags;

    UPDATE resource_history SET category = (SELECT json_agg(x)::jsonb FROM (SELECT t.term, t.scheme, t.label FROM tag_history t WHERE  t.resource_version_id = _vid_) x)
     WHERE resource_type = _res_type
      AND version_id = _vid_;
    RETURN res;
END;
$_$;


--
-- Name: fhir_conformance(jsonb); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION fhir_conformance(_cfg jsonb) RETURNS jsonb
    LANGUAGE sql
    AS $$
SELECT json_build_object(
  'resourceType', 'Conformance',
  'identifier', _cfg->'identifier',
  'version', _cfg->'version',
  'name', _cfg->'name',
  'publisher', _cfg->'publisher',
  'telecom', _cfg->'telecom',
  'description', _cfg->'description',
  'status', 'active',
  'date', _cfg->'date',
  'software', _cfg->'software',
  'fhirVersion', _cfg->'fhirVersion',
  'acceptUnknown', _cfg->'acceptUnknown',
  'format', _cfg->'format',
  'rest', ARRAY[json_build_object(
    'mode', 'server',
    'operation', ARRAY['{ "code": "transaction" }'::json, '{ "code": "history-system" }'::json],
    'cors', _cfg->'cors',
    'resource',
      (SELECT json_agg(
          json_build_object(
            'type', e.path[1],
            'profile', json_build_object(
              'reference', _cfg->>'base' || '/Profile/' || e.path[1]
            ),
            'readHistory', true,
            'updateCreate', true,
            'operation', ARRAY['{ "code": "read" }'::json, '{ "code": "vread" }'::json, '{ "code": "update" }'::json, '{ "code": "history-instance" }'::json, '{ "code": "create" }'::json, '{ "code": "history-type" }'::json],
            'searchParam',  (
              SELECT  json_agg(t.*)  FROM (
                SELECT sp.name, sp.type, sp.documentation
                FROM fhir.resource_search_params sp
                  WHERE sp.path[1] = e.path[1]
              ) t
            )

          )
        )
        FROM fhir.resource_elements e
        WHERE array_length(path,1) = 1
      )
  )]
)::jsonb;
$$;


