-- Name: index_codeable_concept_to_token(character varying, jsonb); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION index_codeable_concept_to_token(_param_name character varying, _item jsonb) RETURNS jsonb[]
    LANGUAGE plpgsql
    AS $$
DECLARE
  coding jsonb;
  res jsonb[] := array[]::jsonb[];
BEGIN
  IF (_item->'text') IS NOT NULL THEN
    res := res || json_build_object('param', _param_name, 'text', _item->>'text')::jsonb;
  END IF;

  FOR coding IN
    SELECT jsonb_array_elements(_item->'coding')
  LOOP
    res := res || index_coding_to_token(_param_name, coding);
  END LOOP;

  RETURN res;
END;
$$;


