    END LOOP;
  END LOOP;
  RETURN result;
END
$$;


--
-- Name: index_resource(uuid, character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION index_resource(id uuid, res_type character varying) RETURNS uuid
    LANGUAGE plpgsql
    AS $_$
DECLARE
  rec RECORD;
  rsrs jsonb;
BEGIN
  EXECUTE
    _tpl($SQL$
      SELECT content FROM "{{tbl}}"
        WHERE logical_id = $1
        LIMIT 1
    $SQL$, 'tbl', res_type)
  INTO rsrs USING id;
  RETURN index_resource(id, res_type, rsrs);
END
$_$;


--
-- Name: index_resource(uuid, character varying, jsonb); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION index_resource(id uuid, res_type character varying, _rsrs jsonb) RETURNS uuid
    LANGUAGE plpgsql
    AS $_$
DECLARE
  rec RECORD;
  idx jsonb;
BEGIN
  -- indexing strings
  FOR idx IN
    SELECT unnest(index_string_resource(_rsrs))
  LOOP
    EXECUTE
      _tpl($SQL$
        INSERT INTO "{{tbl}}_search_string"
        (resource_id, param, value)
        SELECT $1,$2, jsonb_array_elements_text($3)
      $SQL$, 'tbl', res_type)
    USING id, idx->>'param', idx->'value';
  END LOOP;

  -- indexing tokens
  FOR idx IN
    SELECT unnest(index_token_resource(_rsrs))
    UNION
    SELECT json_build_object('param', '_id', 'code', id, 'text', id)::jsonb
  LOOP
    EXECUTE
      _tpl($SQL$
        INSERT INTO "{{tbl}}_search_token"
        (resource_id, param, namespace, code, text)
        SELECT $1, $2->>'param', $2->>'system', $2->>'code', $2->>'text'
      $SQL$, 'tbl', res_type)
    USING id, idx;
  END LOOP;

  -- indexing dates
  FOR idx IN
    SELECT unnest(index_date_resource(_rsrs))
  LOOP
    EXECUTE
    _tpl($SQL$
      INSERT INTO "{{tbl}}_search_date"
      (resource_id, param, "start", "end")
      SELECT $1, $2->>'param', ($2->>'start')::timestamptz, ($2->>'end')::timestamptz
    $SQL$, 'tbl', res_type)
    USING id, idx;
  END LOOP;

  -- indexing quantity
  FOR idx IN
  SELECT unnest(index_quantity_resource(_rsrs))
  LOOP
    EXECUTE
      _tpl($SQL$
        INSERT INTO "{{tbl}}_search_quantity"
        (resource_id, param, value, comparator, units, system, code)
        SELECT $1, $2->>'param', ($2->>'value')::decimal, $2->>'comparator', $2->>'units', $2->>'system', $2->>'code'
      $SQL$, 'tbl', res_type)
    USING id, idx;
  END LOOP;

  -- indexing number
  FOR idx IN
  SELECT unnest(index_number_resource(_rsrs))
  LOOP
    EXECUTE
      _tpl($SQL$
        INSERT INTO "{{tbl}}_search_number"
        (resource_id, param, value)
        SELECT $1, $2->>'param', ($2->>'value')::decimal
      $SQL$, 'tbl', res_type)
    USING id, idx;
  END LOOP;

  -- indexing references
  FOR idx IN
  SELECT unnest(index_reference_resource(_rsrs))
  LOOP
    EXECUTE
    _tpl($SQL$
      INSERT INTO "{{tbl}}_search_reference"
      (resource_id, param, logical_id, resource_type, url)
      SELECT $1, $2->>'param', $2->>'logical_id', $2->>'resource_type', $2->>'url';
    $SQL$, 'tbl', res_type)
    USING id, idx;
  END LOOP;

  -- indexing all references (for includes)
  FOR idx IN
  SELECT unnest(index_all_resource_references(_rsrs))
  LOOP
  EXECUTE
    _tpl($SQL$
      INSERT INTO "{{tbl}}_references"
      (resource_id, path, reference_type, logical_id)
      SELECT $1, $2->>'path', $2->>'reference_type', $2->>'logical_id';
    $SQL$, 'tbl', res_type)
  USING id, idx;
  END LOOP;
  RETURN id;
END
$_$;


--
-- Name: index_schedule_to_date(character varying, jsonb); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION index_schedule_to_date(_param_name character varying, _item jsonb) RETURNS jsonb[]
    LANGUAGE plpgsql
    AS $$
DECLARE
  res jsonb[];
BEGIN
  IF (_item->'repeat') IS NULL THEN
    SELECT array_agg(json_build_object(
      'param', _param_name,
      'start', ev->>'start',
      'end', ev->>'end'
      )::jsonb)
    FROM json_array_elements((_item->'event')::json) AS ev
    INTO res;
    RETURN res;
  ELSE
    IF (_item->'event'->0->'start') IS NOT NULL OR (_item->'repeat'->'end') IS NOT NULL THEN
      RETURN array[json_build_object(
        'param', _param_name,
        'start', _item->'event'->0->>'start',
        'end', _item->'repeat'->>'end'
      )::jsonb];
    ELSE
      RETURN array[]::jsonb[];
    END IF;
  END IF;
END;
$$;


--
-- Name: index_sorting(uuid, character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION index_sorting(_id uuid, res_type character varying) RETURNS text
    LANGUAGE plpgsql
    AS $_$
BEGIN
  EXECUTE
    _tpl($SQL$
      INSERT INTO {{tbl}}_sort
      (resource_id, param, lower, upper)

      SELECT resource_id, param, MIN(value), MAX(value)
        FROM {{tbl}}_search_string
       WHERE resource_id = $1
    GROUP BY param, resource_id

       UNION

      SELECT resource_id, param, MIN(code), MAX(code)
        FROM {{tbl}}_search_token
       WHERE resource_id = $1
    GROUP BY param, resource_id

       UNION

      SELECT resource_id, param, "start"::varchar, "end"::varchar
        FROM {{tbl}}_search_date
       WHERE resource_id = $1
    GROUP BY param, resource_id, "start", "end"

       UNION

      SELECT resource_id, param, MIN(logical_id), MAX(logical_id)
        FROM {{tbl}}_search_reference
       WHERE resource_id = $1
    GROUP BY param, resource_id

       UNION

      SELECT resource_id, param,
             numeric_to_sortable_varchar(MIN(value)),
             numeric_to_sortable_varchar(MAX(value))
        FROM {{tbl}}_search_quantity
       WHERE resource_id = $1
    GROUP BY param, resource_id

      UNION

      SELECT resource_id, param,
             numeric_to_sortable_varchar(MIN(value)),
             numeric_to_sortable_varchar(MAX(value))
        FROM {{tbl}}_search_number
       WHERE resource_id = $1
    GROUP BY param, resource_id
    $SQL$, 'tbl', res_type)
  USING _id;
  RETURN _id;
END
$_$;


