--

CREATE FUNCTION merge_tags(_id_ uuid, res_type character varying, _tags jsonb) RETURNS jsonb
    LANGUAGE plpgsql
    AS $_$
DECLARE
  res jsonb;
BEGIN
  EXECUTE
    _tpl($SQL$
      SELECT json_agg(row_to_json(tgs))::jsonb
        FROM (
          SELECT tg->>'scheme' as scheme,
                 tg->>'term' as term,
                 tg->>'label' as label
          FROM jsonb_array_elements($2) tg
          UNION
          SELECT scheme as scheme,
                 term as term,
                 label as label
          FROM {{tbl}}_tag
          WHERE resource_id = $1
        ) tgs
    $SQL$, 'tbl', res_type)
  INTO res USING _id_, _tags;

  RETURN res;
END
$_$;


